import styled from "styled-components";

export const Container = styled.header` 
    display: flex;
    justify-content: center;
    min-height: 50px !important;
    max-height: 23rem;
    position: relative;
`;

export const Content = styled.div`
    position: absolute;
    left: 10%;
    top: 10%;
`;

export const Lista = styled.div`
    top: 10%;
    li {
        display: inline;
        margin-left: 20px ;
    }
    position: absolute;
    
`;
